style.css:
/* Main Heading */
h1 {
  font-size: 3em;
  font-weight: bold;
  text-align: center;
  margin: 0.5em 0;
}

/* Subheading */
h2 {
  font-size: 2em;
  font-weight: bold;
  margin: 1em 0;
}

/* Paragraph */
p {
  font-size: 1.2em;
  line-height: 1.5;
  margin: 1em 0;
}

/* Links */
a {
  color: #0077cc;
  text-decoration: none;
}

a:hover {
  text-decoration: underline;
}

/* Lists */
ul, ol {
  margin: 1em 0;
  padding-left: 2em;
}

/* List Items */
li {
  margin: 0.5em 0;
}

/* Buttons */
button {
  padding: 0.5em 1em;
  font-size: 1.2em;
  border-radius: 0.5em;
  background-color: #0077cc;
  color: #ffffff;
  border: none;
  cursor: pointer;
}

button:hover {
  background-color: #005ea2;
}
